MultiLanguageSpellData['cn'][90521] = {name = "[q3]发条侏儒", additional_info = "3秒 施法时间 15\n[q]机械侏儒是泰坦的造物。就像土灵一样，它们最初应该是泰坦的仆人和管家。这个机械侏儒显然是损坏了，因为它不再专注于自己本来的工作，却只喜欢跟着你跑。\n[q3]发条侏儒\n拾取后绑定\n[q2]使用:  教你学会召唤这种小伙伴。\n[q2]右键点击以召唤或解散你的发条侏儒。"}
