MultiLanguageSpellData['cn'][90608] = {name = "[q4]辛洛斯，诸界的毁灭者", additional_info = "3秒 施法时间 15\n[q]据你的研究，这件珍贵武器，曾是夺灵者哈卡在祖尔格拉布的众多收藏物之一。哈卡在多年前被击败后，这把剑就在许多强大的战士和圣骑士的手上流传着，直到变得支离破碎。重要的是，你现在已经有能力重铸这把剑。不过，一旦诸界的毁灭者再度出鞘，也许会带来麻烦，因为离夺灵者的归来可能也已不远了。\n[q4]辛洛斯，诸界的毁灭者\n账号绑定\n唯一双手 剑\n1,894 - 2,842伤害 速度 3.80\n（每秒伤害623.16）\n+341 力量\n+512 耐力\n耐久: 120 / 120\n85"}
MultiLanguageSpellData['cn'][90609] = {name = "[q0]粉珠串饰", additional_info = "3秒 施法时间 5\n[q]这一串珍珠中并没有某一颗是特别硕大的，但令人称奇的是，所有四十二颗珍珠竟然完全一样，没有丝毫差异。它们既非普通珍珠的乳白色，也不是那种罕见的黑珍珠，而是闪耀着一种粉色玫瑰的光彩。在这串珍珠中间，还缀着一枚贝壳。\n[q0]粉珠串饰\n拾取后绑定"}
MultiLanguageSpellData['cn'][90610] = {name = "[q0]一箱精致的玻璃动物", additional_info = "3秒 施法时间 5\n[q]真是令人惊叹，你在这只箱子里找到的精灵玻璃动物足以装满一个动物园。箱子可能原本就是被用来收纳这些动物的。随着时代变迁，这些动物身上难免会出现一些裂纹和瑕疵，但这只牡鹿的头显然是被有意砍掉的。箱子的底部雕刻着一个大写字母——“T”。\n[q0]一箱精致的玻璃动物\n拾取后绑定"}
MultiLanguageSpellData['cn'][90611] = {name = "[q0]开裂的水晶瓶", additional_info = "3秒 施法时间 5\n[q]这只瓶子上系着一张用上等犊牛皮纸写的纸条。“最亲爱的P，得知我们将永远无法在一起，我唯一的愿望就是喝下苦苦的蜘蛛毒液。如果你看到了这封信，那么我希望你也会这样做。愿艾露恩庇护我们的灵魂。”\n[q0]开裂的水晶瓶\n拾取后绑定"}
MultiLanguageSpellData['cn'][90612] = {name = "[q0]萨维斯的节杖", additional_info = "3秒 施法时间 5\n[q]在上古战争中，暗夜精灵蒙受的许多劫难都是由萨维斯一手造成的。终于，玛法里奥·怒风将他战败，并摧毁了他的身躯。此后，萨维斯的灵魂饱受萨格拉斯的折磨，又被萨格拉斯强行放进一具扭曲的肉体中，成为了第一个萨特。\n[q0]萨维斯的节杖\n拾取后绑定"}
MultiLanguageSpellData['cn'][90614] = {name = "[q3]卡多雷风铃", additional_info = "3秒 施法时间 15\n[q]这些风铃是一系列纹饰华丽、长度不一的青铜管，它们都挂在一根形如藤蔓的青铜细绳上。这件物品显然具有魔法，即使在没风的时候，这些风铃也会演奏出乐曲。\n[q3]卡多雷风铃\n拾取后绑定\n玩具\n[q2]使用: 把风铃放在空中看看天气如何。 (1分钟 冷却)"}
