MultiLanguageSpellData['cn'][90616] = {name = "[q4]艾萨拉女王的便袍", additional_info = "3秒 施法时间 15\n[q]一般都认为艾萨拉是最美丽的暗夜精灵。不幸的是，从这件长袍过份耀眼的色彩来看，她的审美品位应该像她的许多同胞一样狭窄。“前无古人，后无来者的……艾萨拉。”\n[q4]艾萨拉女王的便袍\n账号绑定\n胸部 布甲\n258护甲\n+27 耐力\n+41 智力\n耐久: 165 / 165\n51\n[q]\"关于上层精灵品位低下的传言看来是真的。\""}
MultiLanguageSpellData['cn'][90617] = {name = "[q0]长羽毛的迅猛龙前肢", additional_info = "3秒 施法时间 5\n[q]一些探险者协会的成员相信鸟是恐龙的后裔。也就是说，这只迅猛龙可能是鸟的始祖。而这些绒毛很可能揭示了这两个不同物种之间久已失落的联系。或者它可能只是艾泽拉斯诸多奇异生物中的一员。\n[q0]长羽毛的迅猛龙前肢\n拾取后绑定"}
MultiLanguageSpellData['cn'][90618] = {name = "[q0]始祖食人鱼", additional_info = "3秒 施法时间 5\n[q]这具鱼骨受到厚厚的骨膜保护，双颚上整齐排列着数不清的尖牙。据说海洋曾覆盖了整个大陆，所以在离岸数百里的地方也会发现鱼类化石。\n[q0]邪恶的远古之鱼\n拾取后绑定"}
MultiLanguageSpellData['cn'][90619] = {name = "[q4]化石迅猛龙", additional_info = "3秒 施法时间 15\n[q]当你用某种可怕的魔法让这副骨架恢复如初的时候。这头怪物立刻活了过来。\n[q4]化石迅猛龙\n拾取后绑定\n坐骑\n40\n需要中级骑术\n[q2]使用:  教你学会召唤这种坐骑。\n[q2]召唤或解散一头化石迅猛龙。"}
