MultiLanguageSpellData['cn'][91221] = {name = "[q0]燃眼的战槌", additional_info = "3秒 施法时间 5\n[q]铁矮人领主燃眼极其喜爱战斗。他以挥舞着两把巨大的战锤而为人熟知。你已经重新拼接出了其中的一把，它已经很久没有得到魔法的滋润了。这意味着另一把还在某个地方，也许它依旧是一件强大的武器。\n[q0]燃眼的战槌\n拾取后绑定"}
