MultiLanguageSpellData['cn'][91224] = {name = "[q0]佐伊女皇之令", additional_info = "3秒 施法时间 5\n[q]佐伊女皇之令和佐伊女皇之誓曾经是一对强大的魔法戒指。你找到的是令之戒。非常可惜的是，当它碎裂的时候，就已经失去了一切魔法力量。另外一枚是誓之戒。现在没有人知道它失落在何处，不过也许依旧保存完好。佐伊女皇是一位世人所知甚少的黑铁统治者。不少矮人纵容她对龙的喜爱，尝试为她偷取龙卵或者幼龙时都丢了性命。\n[q0]佐伊女皇之令\n拾取后绑定"}
MultiLanguageSpellData['cn'][91225] = {name = "[q0]铜须的节杖", additional_info = "3秒 施法时间 5\n[q]“铜须”这个词有两重含义：一个矮人部族的名字，以及统治这个部族的家族。王座厅的君王们在统治期间使用过许多节杖。根据传统，铜须君王可以让他的顾问大臣或盟友在某一天的时间里持有他的节杖。这对节杖来说就是个灾难，它们或被带去酒馆，或从山顶掉下来，甚或用来敲打穴居人和其它怪物。\n[q0]铜须的节杖\n拾取后绑定"}
MultiLanguageSpellData['cn'][91226] = {name = "[q3]旅店老板的女儿", additional_info = "3秒 施法时间 15\n[q]据传，布莱尔·护石曾在洛克莫丹附近经营着一家热闹的旅店。他的女儿吉琳远走他乡，最后却传出了一些让她父亲的名望蒙羞的消息。于是布莱尔与一名侏儒术士达成了一个交易，以此能使女儿离家更近一些。术士就把吉琳变成了一块炉石，让她总是会回到旅店。\n[q3]旅店老板的女儿\n拾取后绑定\n唯一\n玩具\n[q2]使用: 使你返回<Hearthstone Location>。与城镇中的旅店老板交谈可以改变你所设定的家的位置。 (30分钟 冷却)"}
MultiLanguageSpellData['cn'][91227] = {name = "[q4]巫王索瑞森的法杖", additional_info = "3秒 施法时间 15\n[q]巫王索瑞森是三锤之战中黑铁矮人的领袖。当他败给铜须部族，甚至于丢失了铁炉堡之后，只得撤退到现在被称为燃烧平原的地方，并建立起一座以他的名字命名的城市。为了击败敌人，疯狂的索瑞森无意中召唤来半神拉格纳罗斯。这场召唤仪式摧毁了他的生命，并形成了现今被称为黑石山的巨大火山。\n[q4]巫王索瑞森的法杖\n账号绑定\n双手 法杖\n1,047 - 1,571伤害 速度 2.10\n（每秒伤害623.33）\n+512 耐力\n+341 智力\n耐久: 120 / 120\n85\n[q2]装备：法术强度提高 1,955点。"}
