MultiLanguageSpellData['cn'][91762] = {name = "[q0]百法师之宝石项圈", additional_info = "3秒 施法时间 5\n[q]巨魔战争中，奎尔萨拉斯精灵在阿曼尼巨魔的进攻下步步败退，距离彻底溃败只差一线。在绝望中，他们向阿拉索的人类传授了奥术魔法的精义。能够向他们学习的人类只有一百名，这是击败巨魔所需要的最少人数。这些人类在掌握施法技巧时显得相当笨拙，但他们对魔法都有着一种天生的热爱。\n[q0]百法师之宝石项圈\n拾取后绑定"}
