MultiLanguageSpellData['cn'][91773] = {name = "[q4]小精灵护符", additional_info = "3秒 施法时间 15\n[q]小精灵是自然的灵体。人们普遍认为它们是死亡暗夜精灵的化身。它们的存在与它们的森林家园和暗夜精灵有着紧密而广泛的联系。在精灵社会的维护与守卫中，它们扮演着重要的角色。在第三次战争的最后一刻，无数小精灵为了击败阿克蒙德而摧毁了自己。所以，今天世界上小精灵的数量已经远远少于往日了。\n[q4]小精灵护符\n拾取后绑定\n玩具\n[q2]使用: 变为小精灵形态，持续20 sec。 (10分钟 冷却)"}
